This is a tribute to the late bollywood actor Sushant Singh Rajput. It's a monologue from his last movie Dil Bechara. This is the scene where Manny (a cancer patient) who is left with just a few days, asks his girlfriend, Kizie (a cancer patient too) to read out the eulogy that she had written for him as he wouldn't be able to listen to it on the day of the funeral. Kizie, while reading out the eulogy, speaks her heart out. She tells about how in such an early age, Pushpinder (the oxygen cylinder that she carries everywhere) became a part of her life and made her life full of darkness and fear. Then she goes on to express her love for Manny and how he had changed her life and taught her to live her life to the fullest. This is one of the most emotional scenes of the movie. I have tried my best. I hope y'all will like it.

